import React from 'react'
import './Feature.css'
const Feature = () => {
  return (
    <div className="period__features section__padding" id="features">
     <div className="period__features-heading">
      <h1  className="gradient__text">Process of Menstruation </h1>
     </div>
    </div>
  )
}

export default Feature
